import React, {Component} from 'react';
import {NavLink} from 'react-router-dom';

export default class ProcessURL extends Component {
    render(){
        const { process } = this.props.match.params;
        return (
            <button type="button" className="btn-arrow-right">
                <NavLink to={"/"+{process}+"/data-input"}><a>{process}</a></NavLink>
            </button>

        )
    };
}
